;; **
;;; # Finding and drawing contours
;;; 
;;; Finding object by their shape is one of the key reason people usually comes to OpenCV. 
;; **

;; @@
(ns lush-storm
  (:require
    [opencv3.utils :as u]
    [opencv3.colors.html :as color]
    [opencv3.core :refer :all]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; ## Finding contour of headphone and drawing rectangles ...
;; **

;; @@
(def headphones 
  (imread "resources/chapter03/sonyheadphones.jpg" IMREAD_REDUCED_COLOR_4))

(def mask
  (-> headphones 
      (cvt-color! COLOR_BGR2GRAY)
      clone   
 	  (threshold! 250 255 THRESH_BINARY_INV)
      (median-blur! 7)))

(u/mat-view mask)

(def masked-input
  (clone headphones))

(set-to masked-input (new-scalar 0 0 0) mask)
(u/mat-view masked-input)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"629\" height=\"330\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x1d3de1ab \"BufferedImage@1d3de1ab: type = 10 ColorModel: #pixelBits = 8 numComponents = 1 color space = java.awt.color.ICC_ColorSpace@55fc79e5 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 629 height = 330 #numDataElements 1 dataOff[0] = 0\"]"}
;; <=

;; @@
(def exercice-1 (clone headphones))

(def contours 
  (new-arraylist))

(find-contours 
  masked-input
  contours 
  (new-mat) 
  RETR_TREE CHAIN_APPROX_SIMPLE)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(def interesting-contours 
  (filter 
    #(and (> (contour-area %) 100 ) (> (.height (bounding-rect %)) 28)) 
    contours))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;lush-storm/interesting-contours</span>","value":"#'lush-storm/interesting-contours"}
;; <=

;; @@
(doseq [c interesting-contours]
    (let [ rect (bounding-rect c)]
      (rectangle
        exercice-1
        (new-point (.x rect) (.y rect))
        (new-point (+ (.width rect) (.x rect)) (+ (.y rect) (.height rect)))
        (color/->scalar "#ccffcc")
        2)))

(u/mat-view exercice-1)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"629\" height=\"330\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x1cd6e568 \"BufferedImage@1cd6e568: type = 10 ColorModel: #pixelBits = 8 numComponents = 1 color space = java.awt.color.ICC_ColorSpace@55fc79e5 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 629 height = 330 #numDataElements 1 dataOff[0] = 0\"]"}
;; <=

;; **
;;; ## Using core draw-contours to ... draw the contours
;; **

;; @@
(def exercice-2 (clone headphones))

(doseq [c interesting-contours]
 (let [ rect (bounding-rect c) center (u/center-of-rect rect) ]
   (circle exercice-2
           center
           (u/distance-of-two-points center (.tl rect)) 
           (color/->scalar "#ccffcc") 
           2)))


(u/mat-view exercice-2)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"629\" height=\"330\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x67f652ef \"BufferedImage@67f652ef: type = 10 ColorModel: #pixelBits = 8 numComponents = 1 color space = java.awt.color.ICC_ColorSpace@55fc79e5 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 629 height = 330 #numDataElements 1 dataOff[0] = 0\"]"}
;; <=

;; @@
(def exercice-3 (clone headphones))

(dotimes [ci (.size contours)]
 (draw-contours 
   exercice-3
   contours 
   ci 
   (color/->scalar "#ccffcc") 
   2))

(u/mat-view exercice-3)
